"arg" : "Исследования показали, что по сравнению с менее активными людьми у более активных людей:

* ниже риск развития сердечных заболеваний;
* лучше сон и психическое состояние;
* выше вероятность поддерживать здоровый вес."

"arg" : "Досліджння свідчать, що порівняно з менш активними людьми, активніші особи:

* мають менший ризик серцевих хвороб;
* мають кращий сон і психічний стан;
* краще підтримують здорову вагу."
